import React from 'react';
import ServiceContainer from './ServiceContainer';
import ServiceTitle from './ServiceTitle';
import ServiceDescription from './ServiceDescription';
import Separator from './Separator';
import texture from '../../images/textures/texture_black.png';
import textureWhite from '../../images/textures/texture_white.png';
import federation from '../../images/brands/raco_federation.png';
import federationPhoto from '../../images/services/services_fed.jpg';
import mkt from '../../images/brands/raco_mkt.png';
import mktPhoto from '../../images/services/services_mkt.jpg';
import events from '../../images/brands/raco_events.png';
import eventsPhoto from '../../images/services/services_events.jpg';
import consulting from '../../images/brands/raco_consulting.png';
import consultingPhoto from '../../images/services/services_consulting.jpg';
import athletes from '../../images/brands/raco_athletes.png';
import athletesPhoto from '../../images/services/services_deportistas.jpg';
import global from '../../images/brands/raco_global.png';
import globalPhoto from '../../images/services/services_global.jpg';

const ServicesView = () => {
  const bgStyle = { 
    backgroundImage: `url(${texture})`,
    backgroundSize: '1450px',  
  };

  const bgWhiteStyle = { 
    backgroundImage: `url(${textureWhite})`,
    backgroundSize: '1450px',  
  };

  return (
    <>
      <div className="values-container">
        <ServiceContainer id="federation-container" style={bgStyle}>
          <ServiceTitle logo={federation} title="ADMINISTRACIÓN Y CONSULTORÍA FEDERATIVA" />
          <ServiceDescription 
            photo={federationPhoto} 
            descriptionPoints={[
              "01. ADMINISTRACIÓN Y GESTIÓN DE LOS RECURSOS",
              "02. GESTIÓN DE PROYECTOS",
              "03. BACK OFFICE CORPORATIVO"
            ]}
          />
        </ServiceContainer>

        <Separator position="up" />

        <ServiceContainer id="mkt-container" style={bgWhiteStyle} isWhite={true}>
          <ServiceTitle logo={mkt} title="GESTIÓN DE INVERSIÓN PÚBLICA Y PLANES DE PATROCINIO" isLeftAligned={true} />
          <ServiceDescription 
            photo={mktPhoto} 
            descriptionPoints={[
              "01. NUEVAS VÍAS DE FINANCIAMIENTO PÚBLICO",
              "02. ACUERDOS DE PATROCINIO",
              "03. RETORNOS A LA INVERSIÓN"
            ]}
            isLeftAligned={true}
          />
        </ServiceContainer>

        <Separator position="down" />

        <ServiceContainer id="events-container" style={bgStyle}>
          <ServiceTitle logo={events} title="PRODUCCIÓN DE EVENTOS" />
          <ServiceDescription 
            photo={eventsPhoto} 
            descriptionPoints={[
              "01. EXPERIENCIA Y EFICIENCIA",
              "02. CREATIVIDAD Y PERSONALIZACIÓN",
              "03. COMUNICACIÓN Y DIFUSIÓN"
            ]}
          />
        </ServiceContainer>

        <Separator position="up" />

        <ServiceContainer id="athletes-container" style={bgWhiteStyle} isWhite={true}>
          <ServiceTitle logo={athletes} title="MANAGEMENT Y REPRESENTACIÓN DE DEPORTISTAS" isLeftAligned={true} />
          <ServiceDescription 
            photo={athletesPhoto} 
            descriptionPoints={[
              "01. NUEVAS OPORTUNIDADES COMERCIALES",
              "02. ASESORAMIENTO ESTRATÉGICO",
              "03. SOCIAL MEDIA MANAGEMENT"
            ]}
            isLeftAligned={true}
          />
        </ServiceContainer>

        <Separator position="down" />

        <ServiceContainer id="consulting-container" style={bgStyle}>
          <ServiceTitle logo={consulting} title="ESTRATEGIAS DE POSICIONAMIENTO" />
          <ServiceDescription 
            photo={consultingPhoto} 
            descriptionPoints={[
              "01. PARNETSHIPS ESTRATÉGICOS",
              "02. ESTRATEGIAS DE POSICIONAMIENTO"
            ]}
          />
        </ServiceContainer>

        <Separator position="up" />

        <ServiceContainer id="global-container" style={bgWhiteStyle} isWhite={true}>
          <ServiceTitle logo={global} title="EXPANSIÓN INTERNACIONAL DEL DEPORTE" isLeftAligned={true} />
          <ServiceDescription 
            photo={globalPhoto} 
            descriptionPoints={[
              "01. ANÁLISIS DE MERCADO GLOBAL",
              "02. ESTRATEGIAS DE EXPANSIÓN GLOBAL"
            ]}
            isLeftAligned={true}
          />
        </ServiceContainer>

        <Separator position="down" />
      </div>
    </>
  );
};

export default ServicesView;
